    data: |
      SELECT DISTINCT - - cor0.col0 + + cor0.col1 * col0 + - cor0.col0 * col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1762.out
    data: |
      3
      64
      80
